// src/components/Projects.js
import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

const projects = [
  {
    title: "E-Commerce Website",
    description:
      "A full-featured e-commerce app with product listings, shopping cart, user auth, and admin panel.",
    tech: ["React", "Node.js", "Express", "MongoDB"],
    link: "https://github.com/pavithra123456678/ecommerce-website",
  },
  {
    title: "AI Image Generator",
    description:
      "An app that uses OpenAI's API to generate AI images based on user prompts.",
    tech: ["React", "OpenAI API", "Tailwind CSS"],
    link: "https://github.com/pavithra123456678/ai-image-generator",
  },
];

const Projects = () => {
  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  return (
    <section id="projects" className="py-20 bg-gray-100">
      <div className="max-w-6xl mx-auto px-6">
        <h2 className="text-3xl font-bold text-center mb-10">Projects</h2>
        <div className="grid md:grid-cols-2 gap-10">
          {projects.map((project, index) => (
            <div
              key={index}
              data-aos="fade-up"
              className="bg-white rounded-lg shadow-md p-6 hover:shadow-xl transition-shadow"
            >
              <h3 className="text-xl font-semibold mb-2">{project.title}</h3>
              <p className="text-gray-700 mb-3">{project.description}</p>
              <ul className="flex flex-wrap gap-2 mb-4">
                {project.tech.map((tech, idx) => (
                  <li
                    key={idx}
                    className="bg-blue-100 text-blue-800 px-2 py-1 text-xs rounded"
                  >
                    {tech}
                  </li>
                ))}
              </ul>
              <a
                href={project.link}
                target="_blank"
                rel="noopener noreferrer"
                className="text-blue-500 hover:underline"
              >
                View on GitHub â†’
              </a>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
